import './components.css'


function Header(){
    return(
        <header>
            <div class='wrap-text'>
                <h1 class='header-writing'>Diplomatic Pulse</h1>
                
                <div class='plus'><svg xmlns="http://www.w3.org/2000/svg" width="80" height="40" fill="#4dd2ff" class="bi bi-plus-lg" viewBox="-2 -2 8 16">
                    <path d="M8 0a1 1 0 0 1 1 1v6h6a1 1 0 1 1 0 2H9v6a1 1 0 1 1-2 0V9H1a1 1 0 0 1 0-2h6V1a1 1 0 0 1 1-1z"/>
                </svg></div>
            </div>
            <hr class="solid"></hr>
            <h1 class='smaller-header-writing'> Advanced Reading Tool</h1>
        </header>
    )
}

export default Header;
